import React from "react";

const DisplayBox2 = (props) => {
  console.log(props.data);
  const top = props.data.filter((x, index) => index <= 10);
  const topList = top.map((x, index) => {
    return (
      <div className="trendingAnime" key={index}>
        <p className="animeRank">Rank: {x.rank}</p>
        <a href={x.trailer}>
          <img src={x.image_url} alt="" />
          <p className="animeTitle">{x.title}</p>
        </a>
      </div>
    );
  });

  return (
    <div className="anime">
      <div className="animeTop">{props.innerTxt}</div>
      <div className="animeBot">
        <div className="trendingAnimeBox">{topList}</div>
      </div>
    </div>
  );
};
export default DisplayBox2;
